import React from 'react';
import {DormElement} from "../DormElement/DormElement";
import "./Navigation.css";
import { Menu, MenuContent, MenuList, MenuItem } from '@patternfly/react-core';


const dormElems = new Array(21).fill('')
const Navigation: React.FunctionComponent = () => {
    const [activeItem, setActiveItem] = React.useState(0);



    return (
        <Menu isScrollable className="Menu">
            <MenuContent className="MenuContent">
                <MenuList className="MenuList">
                    {/*випадаючі списки комутаторів гуртожитків*/}
                    {dormElems.map((_, idx) => {
                        return (<MenuItem key={`navigation-dorm-elem-${idx}`} itemId={0}>
                            <DormElement id={idx + 1} />
                        </MenuItem>)
                    })}


                </MenuList>
            </MenuContent>
        </Menu>
    );
};



export default Navigation;
